from keras.models import load_model
import cv2
import os
import numpy as np
model = load_model('model-017.model')
label_dict={'withincorrectmask': 0, 'withmask': 1, 'withoutmask': 2}
labels_dict=dict([(value,key) for key,value in label_dict.items()])
color_dict={0:(0,0,255),1:(0,255,0),2:(255,0,0)}

# Commented out IPython magic to ensure Python compatibility.
#!pip install mtcnn
from mtcnn.mtcnn import MTCNN
def pred(path):
    import cv2
    img=cv2.imread(path)
#     %pylab inline
    detector = MTCNN()
    result=detector.detect_faces(img)
    gray=cv2.cvtColor(img,cv2.COLOR_BGR2GRAY)
    for r in result:
      if r['confidence']>0.9:
        x,y,w,h=r['box']
        face_img=gray[y:y+w,x:x+w]
        resized=cv2.resize(face_img,(50,50))
        normalized=resized/255.0
        reshaped=np.reshape(normalized,(1,50,50,1))
        result=model.predict(reshaped)
        label=np.argmax(result,axis=1)[0]
        cv2.rectangle(img,(x,y),(x+w,y+h),color_dict[label],2)
        cv2.rectangle(img,(x,y-40),(x+w,y),color_dict[label],-1)
        cv2.putText(img, labels_dict[label], (x, y-10),cv2.FONT_HERSHEY_SIMPLEX,0.8,(255,255,255),2)
    title("Image with faces detected")
    axis("off")
    imshow(img)
    show()
    print(labels_dict[label])

